**Example 1: Hardcoded Strings**

In a file named `book.js`, we have the following code:
```javascript
// book.js
const bookTitle = 'The Great Gatsby';
const bookAuthor = 'F. Scott Fitzgerald';

// ...
```
In this example, the book title and author are hardcoded as English strings. This is an i18n violation because it assumes that all users will understand English.

**Example 2: Inconsistent File Naming**

In a file named `bookList.en.js`, we have the following code:
```javascript
// bookList.en.js
