Here is an example of how you can use the `readline` module to get user input in TypeScript:

```typescript
import * as readline from 'readline';

const rl = readline.createInterface({
  input: process.stdin,
  output: process.stdout
});

rl.question('Please enter your name: ', (answer) => {
  console.log(`Hello, ${answer}!`);
  rl.close();
});
```

In this example, we first import the `readline` module. Then we create a `readline` interface with `createInterface()` method. This method takes an options object with `input` and `output` properties, which we set to `process.stdin` and `process.stdout` respectively.

Then we use the `question()` method to prompt the user to enter their name. This method takes a string prompt and a callback function. The callback function is called with the user's answer as an argument.

Finally, we log a greeting message to the console with the user's name, and close the `readline` interface with `close()` method.

